    },
  
   footer_main:{    
       display:'flex',
       justifyContent:'space-evenly',
       alignItems:'center',
       flexDirection:'row',
       textAlign:'center',
       margin:20
   },
   tinyLogo: {
    width: 16,
    height: 16,
    textAlign:'center',    
    margin:10,
    marginLeft:25,
  },
  text:{
    color:'#8D8D8D',
    fontFamily:'roboto',
    weight:400,
